  false,\n\t\"url\": null,\n\t\"notes\": \"The VT Cable Modem dataset (CABLEMOD2005)
  includes lines depicting the extent of Vermont's cable modem broadband system as
  of 12/31/2005. This data layer was generated by extracting a subset of features
  from UtilityTelecom_CABLE2005. The following subset was used: CABLECO = Adelphia,
  Charter, Duncan Cable, Jeffersonville, North Country Cable, Smuggler's Notch, Southern
  Vermont Cable, Stowe Cablevision, or Transvideo. These represent cable companies
  which also provide broadband \"cable modem\" service within their territory.\",\n\t\"owner_org\":
